package dev.whyoleg.cryptography.bigint

import kotlin.math.*
import kotlin.random.*
import kotlin.test.*

class BigIntStringTest {

    @Test
    fun testWrongStrings() {
        listOf(
            "",
            " ",
            "asd",
            "123+23",
            "--123"
        ).forEach {
            assertFails { it.toBigInt() }
            assertNull(it.toBigIntOrNull())
        }
    }

    @Test
    fun testZeroStrings() {
        listOf(
            "0",
            "00",
            "0".repeat(100)
        ).forEach {
            val bigInt = it.toBigInt()
            assertEquals(BigInt.ZERO, bigInt)
            assertEquals("0", bigInt.toString())
            assertContentEquals(byteArrayOf(0), bigInt.encodeToByteArray())
        }
    }

    @Test
    fun testStringsWithZero() {
        listOf(
            "1",
            "322",
            Random.nextInt(0, Int.MAX_VALUE).toString(),
            Random.nextLong(0, Long.MAX_VALUE).toString(),
            "1263871268736128736812793712098379812768736456283746891298343"
        ).forEach { s1 ->
            val b1 = s1.toBigInt()
            listOf(
                "0$s1",
                "0000$s1",
                "+$s1",
                "+0$s1",
                "+000$s1"
            ).forEach { s2 ->
                val b2 = s2.toBigInt()
                assertEquals(b1, b2)
                assertEquals(b1.toString(), b2.toString())
                assertContentEquals(b1.encodeToByteArray(), b2.encodeToByteArray())
            }
        }
    }

    @OptIn(ExperimentalUnsignedTypes::class)
    @Test
    fun testRandomStrings() {
        fun test(digits: Int) {
            val from = (10.0.pow(digits - 1) / 3).toInt() + 1
            val until = (10.0.pow(digits) / 3).toInt()
            val length = Random.nextInt(from, until)
            val string = Random.nextBytes(length).asUByteArray().joinToString("")
                // remove leading zeros - they are removed during encoding
                .dropWhile { it == '0' }

            checkString(string)
            checkString("-$string")
        }

        repeat(100) { test(2) }
        repeat(1000) { test(3) }
        repeat(100) { test(4) }
        repeat(10) { test(5) }
    }

    @Test
    fun testString1() = checkString(
        string = "15555757860196863684",
        hexPositive = "00d7e1275b1d064ec4",
        hexNegative = "ff281ed8a4e2f9b13c",
    )

    @Test
    fun testString2() = checkString(
        string = "",
        hexPositive = "",
        hexNegative = "",
    )

    @Test
    fun testString3() = checkString(
        string = "",
        hexPositive = "",
        hexNegative = "",
    )

    @Test
    fun testString4() = checkString(
        string = "",
        hexPositive = "",
        hexNegative = "",
    )

    @Test
    fun testString5() = checkString(
        string = "",
        hexPositive = "",
        hexNegative = "",
    )
}
